	},
	{
		"type": "other",
		"description": "6. Install the AWS CDK for Python using: `pip install aws-cdk.core`."
	},
	{
		"type": "other",
		"description": "7. Optionally, install other AWS CDK modules you need, such as `aws-cdk.aws-ec2`, `aws-cdk.aws-ecs`, etc., using pip."
